// CurrencyInput.js
import { useState } from "react";
function CurrencyInput({ currency, flag, value, label, onChange, readOnly }) {
  return (
    <div className="CurrencyInputWrapper">
      <div className="CurrencySelection">
        <img src={flag} alt={currency} className="CurrencyFlag" />
        <input
          type="text"
          className="CurrencyName"
          value={value}
          onChange={onChange}
          placeholder="Enter amount"
          readOnly={readOnly}
        />
      </div>
    </div>
  );
}

// Converter.js
function Converter() {
  const [fromValue, setFromValue] = useState("1");
  const [toValue, setToValue] = useState("1.133705");
  const [date, setDate] = useState("04/08/2023");

  return (
    <div className="Converter">
      <h2 className="Convertertitle">Converter</h2>
      <div className="ConverterBody">
        <CurrencyInput
          currency="MYR"
          flag="my-flag.png"
          value={fromValue}
          onChange={(e) => setFromValue(e.target.value)}
        />

        <button className="ExchangeButton">
          <img src="exchange-icon.svg" alt="swap" />
        </button>

        <CurrencyInput
          currency="SGD"
          flag="sg-flag.png"
          value={toValue}
          readOnly
        />

        <div className="DateInputWrapper">
          <input
            type="text"
            className="DateInput"
            value={date}
            onChange={(e) => setDate(e.target.value)}
          />
        </div>

        <div className="LastUpdateData">
          Last updated 2023-08-04
        </div>
      </div>
    </div>
  );
}

// Chart.js
function Chart() {
  return (
    <div className="LineChart">
      <div className="ChartHeader">
        <h2>SGD to AUD Chart 8.58% 1Y</h2>
        <div className="ChartControls">
          <button className="ChartControl">1W</button>
          <button className="ChartControl">1M</button>
          <button className="ChartControl active">1Y</button>
        </div>
      </div>
      <div className="ChartContent">
        {/* 图表内容 */}
      </div>
    </div>
  );
}

// WatchList.js
function WatchList() {
  const watchlistData = [
    { currency: 'USD', rate: '0.75', change: '2.44', trend: 'up' },
    { currency: 'JPY', rate: '106.11', change: '9.89', trend: 'up' },
    { currency: 'MYR', rate: '3.39', change: '4.56', trend: 'up' },
    { currency: 'THB', rate: '25.88', change: '-0.58', trend: 'down' },
    { currency: 'TWD', rate: '23.63', change: '8.54', trend: 'up' },
    { currency: 'NZD', rate: '1.23', change: '6.07', trend: 'up' }
  ];

  return (
    <div className="ExchangeList">
      <div className="ExchangeListHeader">
        <h2>Exchange Rate Watchlist</h2>
        <button className="EditButton">
          <img src="edit-icon.svg" alt="edit" />
        </button>
      </div>
      <div className="WatchlistContent">
        {watchlistData.map(item => (
          <div className="WatchlistItem" key={item.currency}>
            <div className="CurrencyInfo">
              <img src={`${item.currency.toLowerCase()}-flag.png`} alt={item.currency} />
              <span className="CurrencyCode">{item.currency}</span>
            </div>
            <div className="RateInfo">
              <span className="Rate">{item.rate}</span>
              <span className={`Change ${item.trend}`}>{item.change}</span>
              <div className="MiniChart">
                {/* 迷你图表 */}
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

// App.js
export default function App() {
  return (
    <div className="AppWrapper">
      <main className="App">
        <div className="MainContent">
          <Converter />
          <Chart />
        </div>
        <WatchList />
      </main>
    </div>
  );
}
